import React from "react"
import './App.css';
import Page from  './Page.js';
import ProjectCard from  './ProjectCard.js';
import redesign from './images/redesign/redesign-logo.png'
import iterative_design from './images/merlot.jpeg'
import styletransfer from './images/styletransfer/style_transfer.png'

const projects = [
  {image:iterative_design, title:"Simmer Redesigning", link:"/film" },
  {image:redesign, title:"IMDB Redesigned", link:"/project/redesign"  },
  {image:styletransfer, title:"Style Transfer with Tensorflow", link:"/project/styletransfer"},
  {image:styletransfer, title:"Style Transfer with Tensorflow", link:"/project/styletransfer"}
]

class Project extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    }

  }

  renderList(items) {
    var list = items.map(item => { 
      return <ProjectCard image={item.image} link={item.link} title={item.title}/>
    });
    return list;
  }


  render() {
    return(
    <Page className="project-page">
      <h1> Projects</h1>
      <div className="project-container">
        {this.renderList(projects)}
      </div>
    </Page>

    )}
}

export default Project;
